class tableiter(object):
	def __init__(self, o):
		self.o = o
		self.i = 1
	
	def next(self):
		if self.i not in self.o.data: raise StopIteration()
		a = self.o[self.i]
		self.i += 1
		return a

class table(object):
	def __init__(self, d=None):
		self.fromo(d)
		self.data = {}

	def fromo(self, d):
		if type(d) is dict:
			for k in d: self[k] = d[k]
		elif type(d) is list:
			for i in range(len(d)):
				self[i+1] = d[i]

	def __len__(self):
		i = 0
		while 1:
			if i+1 in self.data: i=i+1
			else: break
		return i
	def __setitem__(self, k, v):
		self.data[k] = v
	
	def __getitem__(self, k):
		return self.data[k]
		
	def __iter__(self):
		return tableiter(self)
	
	def __repr__(self):
		r = '{'
		r += ','.join(["%s=%s" % (x, self[x]) for x in self.keys()])
		r += '}'
		if hasattr(self, 'name'): r = self.name + r
		return r
	
	def keys(self):
		return self.data.keys()

class FAN:
	@staticmethod
	def encode(s, con=None):
		if None is con: 
			con = {}
			con[1]=0
		if type(s) is dict:
			s = con.setdefault(id(s), table(s))
		elif type(s) is list:
			s = con.setdefault(s, table(s))
		if s is True: return '\x01'
		if s is False: return '\x02'
		if type(s) is int or type(s) is long:
			if s <= -33 and s >= -0x8000: return '\x05' + pack('H', 0x10000+s)
			if s < -0x8000 and s > 0x80000000 : return '\x06' + pack('L', 0x100000000+s)
			if s < -0x80000000: return '\x07' + pack('Q', 0x10000000000000000+s)
			if -32 <= s < 0: return pack('B', s + 0x80)
			if 0 <= s <= 30: return pack('B', s + 0x40)
			if s > 30 and s <= 0x7fff: return '\x05' + pack('H', s)
			if s > 0x7fff and s <=0x7fffffff: return '\x06' + pack('L', s)
			if s > 0x7fffffff: return '\x07' + pack('Q', s)
